  const items: EventItem[] = [{ id: '1', src: '/assets/img/israel_pilgrimage.jpg', nombre: '2', prix:'5', total:'10'},
  {id: '1', src: '/assets/img/israel_pilgrimage.jpg', nombre: '1', prix:'4', total:'10'},
