            <IonLabel>
              <br/>
            <h3 className="quantite_order"><b> {image.nombre} </b></h3>
            <h2 className="lieu_event"> {image.prix}  $ </h2>
            
            
            </IonLabel>


            </IonItem>
      ))}

 </IonList>
 <hr className="trait_simple"></hr>
              <IonItem>
                <h2>Total </h2>
                <h2> 80 $ </h2>
              </IonItem>
              <hr className="trait_simple"></hr>
         

          </IonContent>
                
        </IonPage>
        
        
  );
}
